import React, { useState } from 'react';
import './Signup.css';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Signup() {
    const [userName, setUserName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [dob, setDob] = useState("");
    const [role, setRole] = useState("user");
    const [error, setError] = useState("");
    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {

            const data = {
                userName: userName,
                email: email,
                password: password,
                dob: dob,
                role: role
            }
            const response = await axios.post("http://localhost:8009/api/sign-up", data,
            );
            console.log("Signup Successful", response.data);
            navigate("/login");
        } catch (error) {
            setError("Error during signup");
            console.error("Error during signup:", error);
        }
    };

    return (
        <>
            <title>SignUp Form</title>
            <meta name="viewport" content="width=device-width, initial-scale=1" />
            <meta httpEquiv="Content-Type" content="text/html; charset=utf-8" />
            <link href="css/style.css" rel="stylesheet" type="text/css" media="all" />
            <link
                href="//fonts.googleapis.com/css?family=Roboto:300,300i,400,400i,700,700i"
                rel="stylesheet"
            />
            <div className="main-w3layouts wrapper">
                <h1>SignUp Form</h1>
                <div className="main-agileinfo">
                    <div className="agileits-top">
                        <form onSubmit={handleSubmit}>
                            <input
                                className="text"
                                type="text"
                                name="Username"
                                value={userName}
                                onChange={(event) => setUserName(event.target.value)}
                                placeholder="Username"
                                required=""
                            />
                            <input
                                className="text email"
                                type="email"
                                name="email"
                                value={email}
                                onChange={(event) => setEmail(event.target.value)}
                                placeholder="Email"
                                required=""
                            />
                            <input
                                className="text w3lpass"
                                type="date"
                                name="dob"
                                value={dob}
                                onChange={(e) => setDob(e.target.value)}
                                placeholder="Date of Birth"
                                required=""
                            />
                            <input
                                className="text"
                                type="password"
                                name="password"
                                value={password}
                                onChange={(event) => setPassword(event.target.value)}
                                placeholder="Password"
                                required=""
                            />
                            <div className="wthree-text">
                                <label className="anim">
                                    <input type="checkbox" className="checkbox" required="" />
                                    <span>I Agree To The Terms &amp; Conditions</span>
                                </label>
                                <div className="clear"> </div>
                            </div>
                            <input type="submit" value="SIGNUP" />
                        </form>
                        {error && <p className="error-message">{error}</p>}
                        <p>
                            Don't have an Account? <a href="#">Login Now!</a>
                        </p>
                    </div>
                </div>

            </div>
        </>
    );
}

export default Signup;
